(1, '<ul>\r\n	<li class="first">\r\n		<a class="twitter soc" href="#">Twitter</a></li>\r\n	<li>\r\n		<a class="facebook  soc" href="#">Facebook</a></li>\r\n	<li>\r\n		<a class="dribbble  soc" href="#">Dribbble</a></li>\r\n	<li>\r\n		<a class="youtube  soc" href="#">YouTube</a></li>\r\n	<li>\r\n		<a class="vimeo  soc" href="#">Vimeo</a></li>\r\n</ul>\r\n', 'Social links', 'full_html'),
(2, '<h3>\r\n	About us</h3>\r\n<p>We are a team of DesignMD who put maximum effort to satisfy your requirements in terms of WB Desigin. A particular attention we pay to the graphic style, caracterized by fonts letters.</p>\r\n', 'About us', 'full_html'),
(3, '<ul>\r\n	<li>\r\n		<a href="#"><img alt="Images" class="Images" src="http://ddthemes.com/designmd01/sites/all/themes/designmd/images/client/1.png" /></a></li>\r\n	<li>\r\n		<a href="#"><img alt="Images" class="Images" src="http://ddthemes.com/designmd01/sites/all/themes/designmd/images/client/2.png" /></a></li>\r\n	<li>\r\n		<a href="#"><img alt="Images" class="Images" src="http://ddthemes.com/designmd01/sites/all/themes/designmd/images/client/3.png" /></a></li>\r\n	<li>\r\n		<a href="#"><img alt="Images" class="Images" src="http://ddthemes.com/designmd01/sites/all/themes/designmd/images/client/4.png" /></a></li>\r\n	<li>\r\n		<a href="#"><img alt="Images" class="Images" src="http://ddthemes.com/designmd01/sites/all/themes/designmd/images/client/5.png" /></a></li>\r\n	<li>\r\n		<a href="#"><img alt="Images" class="Images" src="http://ddthemes.com/designmd01/sites/all/themes/designmd/images/client/6.png" /></a></li>\r\n</ul>\r\n', 'Client logo', 'full_html'),
(4, '<h2>\r\n	About Page</h2>\r\n', 'About Page', 'full_html'),
(5, '<h2>\r\n	Welcome to the DESIGNMD-01 theme demo</h2>\r\n<p>We are a team of DesignMD who put maximum effort to satisfy your requirements in terms of WB Desigin.A particular attention we pay to the graphic style, caracterized by fonts letters, symbols, allowing us to create an atractive and readable design for your eyes.</p>\r\n', 'Featured block', 'full_html'),
