('node', 'page', 0, 1, 1, 'und', 0, '<div class="one-four m-bottom">\r\n	<h3>\r\n		About team</h3>\r\n	<p>We are a team of <a href="#">DesignMD</a> who put maximum effort to satisfy your requirements in terms of WB Desigin. A particular attention we pay to the graphic style, caracterized by fonts, letters, symbols, allowing us to create an atractive and readable design for your eyes.</p>\r\n	<a class="read" href="#">read more</a></div>\r\n<div class="one-four m-bottom">\r\n	<h3>\r\n		About navigation</h3>\r\n	<p>An easy navigation in combination a well-made design, wile provide a continuing request from customers , wich guarantees your success. Each customer while surfing the site can go deeper in its structure, and enjoy this process. An easy navigation on the site is an advantage for the presperity of your business</p>\r\n	<a class="read" href="#">read more</a></div>\r\n<div class="one-four m-bottom">\r\n	<h3>\r\n		About color</h3>\r\n	<p>Let the colors into your life !!! Our team DesignMD offera you a variety of sccessful with dofferent fonts. You just have to match the right color, the background and the desired font. Definitely we offervour option of color combinations <a href="#">with fonts</a>, but we leave you the opportunity to choose the suitable versions.</p>\r\n	<a class="read" href="#">read more</a></div>\r\n<div class="one-four m-bottom last">\r\n	<h3>\r\n		About code</h3>\r\n	<p>An arranged and readable code allows a quick change af any module in HTML and Css which will save your timeIf you ned our helps or ou advice, we are ready to answer any question as soon as possible you can write your question on the <a href="#">ddteme@gmail.com</a> or in comments</p>\r\n	<a class="read" href="#">read more</a></div>\r\n<p>&nbsp;</p>\r\n', '', 'full_html'),
